sys_variable_value.value:
(function parse(inputs, outputs) {
    var collectDisks = [];
    var item = JSON.parse(inputs.sourceItem);
    for (var i in item) {
        var extractDisks = item[i]['disks'];
        if (extractDisks != undefined) {
            extractDisks.forEach(function(disk) {
                collectDisks.push(disk);
            })

        }
    }
    outputs.targetObject = {
        "disks": collectDisks
    };
})(inputs, outputs)

(function paginate(variables, pageResponse) {
    variables.getNextPage = variables.nextpageToken ? true : false;
})(variables, pageResponse);

